import React from "react";

import {Card, CardHeader, CardContent, Typography, makeStyles} from '@material-ui/core';

import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';

import styles from "assets/jss/material-dashboard-react/views/dashboardStyle.js";

const useStyles = makeStyles(styles);

export default function Kpi1(props) {
    const classes = useStyles();
    return (
        <Card >
            <CardHeader
                avatar={
                    <MonetizationOnIcon />
                }
                titleTypographyProps={{ variant: 'h5' }}
                style={{ textAlign: "left", backgroundColor: "#55ae59", color: "white" }}
                title="Today Sales"
            />
            <CardContent>
                <Typography variant="h5" className={classes.cardTitle}>30 for $1,117.68</Typography>
            </CardContent>
        </Card>
    )
}
